tables.table_schema:
CREATE TABLE public.financial_portfolio (
    portfolio_id INT PRIMARY KEY,
    portfolio_name TEXT,
    risk_level INT,
    stress_test_passed BOOLEAN
);
CREATE TABLE public.portfolio_assets (
    asset_id INT PRIMARY KEY,
    portfolio_id INT REFERENCES public.financial_portfolio(portfolio_id),
    asset_name TEXT,
    asset_type TEXT,
    asset_value DECIMAL
);

CREATE TABLE financial_portfolio (
    portfolio_id INT PRIMARY KEY,
    portfolio_name VARCHAR(255),
    total_value DECIMAL(10, 2)
);

CREATE TABLE asset (
    asset_id INT PRIMARY KEY,
    asset_name VARCHAR(255),
    asset_type VARCHAR(50),
    asset_value DECIMAL(10, 2)
);

CREATE TABLE risk_analysis (
    analysis_id INT PRIMARY KEY,
    portfolio_id INT,
    risk_score DECIMAL(5, 2),
    analysis_date DATE
);

CREATE TABLE stress_testing (
    testing_id INT PRIMARY KEY,
    analysis_id INT,
    stress_level VARCHAR(20),
    test_date DATE
);
